import React from 'react';

class App extends React.Component {
  constructor() {
    super()
    this.state = {
      todos: [],
      isLoaded: false,
    }
  }

  componentDidMount() {
    fetch("https://jsonplaceholder.typicode.com/todos")
        .then(response => response.json())
        .then(data => {
            this.setState({
              todos: data,
              isLoaded: true,
            })
        })
  }

  render() {

    var { todos, isLoaded } = this.state;

    if(!isLoaded) {
        return <div>Loading...</div>
    } else {
        return (
          <div>
              {todos.map(todo => (
                <div key={todo.id} style={{width: "500px", height: "100px", border: "1px solid #000", textAlign: "center", backgroundColor: "#FFFF", borderRadius: "25px"}}>
                    Title: {todo.title} | Completed: {todo.completed === true ? <div>True</div> : <div>False</div>}
                </div>
              ))}
          </div>
        )
    }
  }
}

export default App;
